  constructor() {
    super(props);

    this.state = {
      cars: ["BMW", "MERC", "City", "Audi"]
    };
  }
  render() {
    return (
      <div>
        <h2>Just some info</h2>
        <Cars msg="cars are cool" model="3245" coolCars={this.props.cars} />
